import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const ChangePassword = () => {
  return (
    <>
          <div className="d-flex justify-content-center align-items-center mt-5">
            <div className="col-4">
                <div className="card h-100 justify-content-center">
                  <h5 className="card-header">Change your Password</h5>
                  <div className="card-body d-flex flex-column">
                    <form method="POST">
                      <div className="form-group mb-2">
                          <label htmlFor="name">Change Name<span className="required-field">*</span></label>
                          <input type="text" id="name"   className="form-control" name="name" required/>
                      </div>
                      <div className="form-group mb-2">
                          <label htmlFor="phone">Change Phone<span className="required-field">*</span></label>
                          <input type="text" id="phone"   className="form-control" name="phone" required/>
                      </div>     
                     
                    </form>
                    <button type="submit" name="login" id="login"  className="mt-3 btn btn-sm w-100 btn-outline-dark">Continue</button>
                  </div>
                </div>
            </div>
        </div>
    </>
  );
};

export default ChangePassword;
